B.Gu=new A.tm('TEST Questo\n\xe8 un percorso di scrittura,\nche si presenta\ncome l\u2019esplorazione di un\u2019<b>Isola<b>.\n\nUn viaggio,\nnove tappe,\nventotto esercizi.\n\nOgni esercizio\n\xe8 articolato in tre fasi,\nche io chiamo\n<b>scrittura libera,<b>\n<b>honoo<b> ("on\xf9")\ne\n<b>hinoo<b> (\u201cin\xf9\u201d).\n\n<b>Scrittura libera<b>\nA partire dal tema proposto,\nscrivi per\n almeno dieci minuti,\nnella forma che preferisci.\n\nDedica cio\xe8\nuno spazio quotidiano\nalla scrittura,\ne difendilo.\n\nIn questa fase\npuoi accompagnare\nla scrittura\nad altri metodi\ndi rappresentazione,\ncome la fotografia\no il disegno.\n\nIn effetti\nsarebbe pi\xf9 esatto dire:\n\u201ca partire dal tema proposto,\ninizia una riflessione,\nannotando quello che affiora\nnel modo\nche ti sembra pi\xf9 comodo\u201d.\n\nSecondo me,\nun ottimo risultato\nsarebbe riuscire a \ndedicare a questa fase\nalmeno\nquaranta, cinquanta minuti\nal giorno,\nma non considerarlo\nl\'obiettivo.\n\nL\u2019obiettivo\n\xe8 quello di confrontarsi\ncon questa prima fase\ntutti i giorni,\nsenza saltare alcun giorno.\n\nAvrai bisogno\ndi un orologio:\nsegna l\u2019orario in cui inizi\nla tua <b>scrittura libera<b>\ne continua\nfinch\xe9 non saranno trascorsi\n<b>almeno dieci minuti<b>.\n\nQuando smetti,\nscrivi l\u2019orario in cui smetti,\ne calcola\nquanto \xe8 durata la tua scrittura.\n\nLavora\ncon il massimo della\nconcentrazione,\ndopo aver cercato di eliminare\ntutte le possibili\nfonti di distrazione.\n\nIo scriverei al mattino,\ncon un pennarello molto fluido,\nsu fogli bianchi,\nsenza righe.\n\nSi tratta di gusti:\nti invito a scoprire i tuoi.\n\nTi consiglio\ndi non mostrare a nessuno\nquello che verr\xe0 fuori\nin questa prima fase di scrittura.\n\n<b>honoo<b>\nRileggi con attenzione\ntutto quello\nche\nsei riuscito a far affiorare\ndurante la <b>scrittura libera<b>,\ne poi,\na partire da quello che hai scritto,\nrealizza almeno un <b>honoo<b>.\n\nUn <b>honoo<b>\n\xe8 una composizione\narticolata in un <b>breve testo<b>,\nal massimo\n<b>centoquarantaquattro<b>\n<b>caratteri<b>,\nspazi compresi,\ndisposti\nin un massimo\ndi <b>cinque righe<b>,\ne un\u2019<b>immagine quadrata<b>.\n\nIl testo\n\xe8 <b>formattato al centro<b>\ne scritto in <b>carattere Arvo<b>.\n\nIn questo contesto, \nconsidero l\u2019<b>honoo<b>\nuna tecnica\nper evidenziare\npunti caldi\ndal magma informe\ndella <b>scrittura libera<b>,\ne per iniziare\na coagulare\nquesti punti caldi\nin strutture pi\xf9 complesse.\n\n<b>hinoo<b>\nDopo aver realizzato\nalmeno un <b>honoo<b>,\nscrivi\nalmeno un <b>hinoo<b>.\n\nCol termine <b>hinoo<b>\nintendo\nuna composizione\narticolata\nin una <b>immagine quadrata<b>\nin alto\ne in un <b>testo<b>\ndel numero di righe che vuoi,\ncon un numero massimo\ndi caratteri per rigo,\ncirca trentadue,\nspazi inclusi.\n\nNelle mie intenzioni,\nla scelta espressiva\ndi dove andare a capo,\nnei testi dell\u2019<b>honoo<b>\ne dell\u2019<b>hinoo<b>,\naccende\nun riflettore\nsu alcuni elementi,\ne ci indica\nla strada\nverso\nla nostra storia.\n\nL\u2019ideale\nsarebbe svolgere\nnell\u2019arco della stessa giornata.\nle tre fasi\ndi ogni esercizio:\n<b>scrittura libera<b>,\n<b>honoo<b>\ne\n<b>hinoo<b>.\n\nSe vuoi comporre\ni tuoi <b>honoo<b>\ne i tuoi <b>hinoo<b>,\nclicca sulla Bottiglia.\n\nSe vuoi vedere\ngli <b>honoo<b>\ne gli <b>hinoo<b>\ndegli altri,\nclicca sulla Luna.\n\nSe clicchi sullo Scrigno,\npuoi vedere\ngli <b>honoo<b> e gli <b>hinoo<b>\nche hai scritto,\ngli <b>honoo<b> e gli <b>hinoo<b>\nche hai salvato,\ne gli <b>honoo<b> e gli <b>hinoo<b>\nche hai ricevuto in risposta\nai tuoi <b>honoo<b> e <b>hinoo<b>.\n\nSe vuoi iniziare\nil tuo viaggio sull\u2019<b>Isola<b>,\nclicca su <b>1<b>\ne vai alla\n<b>Grotta delle Rondini<b>.\n',B.i,18,null)
